INSERT INTO `content_information` (`infoid`, `infoitem`, `headline`, `subhead`, `author`, `publish_date`, `content`, `keywords`, `abstract`, `ishow`, `level`, `releaser`, `release_date`, `headcolor`, `subhcolor`, `iscomment`, `isdelete`, `deletedate`, `viewsum`) VALUES
(1, 3, '当今风云变换的世界格局', '', '马文林', '2016-03-03 00:00:00', '<table width=\"650\" class=\"ke-zeroborder\" border=\"0\"><tbody><tr class=\"firstRow\"><td>\r\n				近代以来，国际局势风云变幻。期间，上演了一幕幕大国兴衰的悲喜剧。阅读材料，回答问题。<br/>材料一：“让别的国家去分割大陆和海洋，而我们德国人满足于蓝色天空的时代已经过去了。我们也要求阳光下的地盘。”（皮洛夫）			</td></tr><tr><td><p><img src=\"http://pic1.mofangge.com/upload/papers/c07/20120201/2012020113513503711699.gif\"/> \r\n				</p></td></tr><tr><td>\r\n				（1）“别的国家”主要指哪个国家？“阳光下的地盘”指的是什么？争夺“阳光下地盘”的结果导致了怎样的国际关系格局？<br/>___________________________________________________________________________________________<br/>材料二：下图漫画中的赫鲁晓夫和肯尼迪正在起劲地扳手腕，他们的另一只手分别摁向控制对方导弹的按钮，赫鲁晓夫满头大汗……			</td></tr><tr><td><p><img src=\"http://pic1.mofangge.com/upload/papers/c07/20120201/201202011351350454181.gif\"/> \r\n				</p></td></tr><tr><td>\r\n				（2）材料二是哪一国际格局的生动写照？“双方扳手腕”的典型事件是什么？“双方扳手腕”的最终结局如何？<br/>___________________________________________________________________________________________<br/>（3）20世纪90年代以来，国际格局的发展有何新的趋势？在新格局形成过程中起决定性的因素是什么？<br/>______________________________________________________________________________________			</td></tr></tbody></table><pre class=\"brush:delphi;toolbar:false\">show:false</pre><p><br/></p>', '政局', '近代以来，国际局势风云变幻。期间，上演了一幕幕大国兴衰的悲喜剧。阅读材料，回答问题。材料一：“让别的国家去分割大陆和海洋，而我们德国人满足于蓝色天空的时代已经过去了。我们也要求阳光下的地盘。”（皮洛夫', '1', '0', '马克话费', '2016-03-10 00:00:00', '', '', 0, 0, NULL, NULL),
(2, 11, '网红这10年，揭秘网红炒作背后的真相、猫腻和规律！', '', '作者', '2016-03-14 00:00:00', '<p class=\"text\">\r\n	网络红人至少有10年以上的历史了，从最早的天仙MM、芙蓉姐姐、二月丫头、木子美等等，到网络小胖、程琳、\r\nayawawa、小龙女彤彤、孔燕松、犀利哥、兽兽、凤姐等等，再到奶茶MM、papi酱等等，这些每年都会火很多很多的网络红人。虽然可能很多在现在的\r\n90后、00后看来，已经是上古时代的人物了，但不可否认，当年她（他）们曾在网络上掀起过一片片惊涛骇浪。\r\n</p>\r\n<p class=\"text\">\r\n	当然很多网红现在已经成功转型，芙蓉姐姐已经转型为励志姐，当年红透半边天的天仙MM已经转型为演员，ayawawa已经转型为模特、现为知名作家、心理专家，叫兽易小星已经转型为知名导演，还有一个网红发迹的美女已经转型为了一线明星（不点名了）。\r\n</p>\r\n<p class=\"text\">\r\n	作为一个互联网老人，和中国网络流行文化发源地、舆论阵地猫扑网7年的前员工，这10年多的网络红人，笔者自是大都见证\r\n过的。很多网红其实也都认识，要么至少认识他们的经纪人，比如芙蓉姐姐、ayawawa、叫兽、小龙女彤彤、孔燕松、修罗古蝶丁晗、知知、兽兽、凤姐、李\r\n颖芝、T裤貂蝉SASA、奶茶妹妹等等，当然只是火了一阵，或者小火、小红人，就更多了。而很多当年让众多屌丝流哈喇子的网络美女，现在都已为人妇、为人\r\n母了。当年的很多情形，现在回想起来，依然历历在目。\r\n</p>\r\n<p class=\"image\">\r\n	<img src=\"http://e.hiphotos.baidu.com/news/w%3D638/sign=d713abb68044ebf86d71673ce1f8d736/cb8065380cd791232bae06c1aa345982b2b7803d.jpg\" /> \r\n</p>\r\n<p class=\"text\">\r\n	今天的主题，不是介绍这10年到底有哪些网红，他们是怎么红的，大家自己百科去就行了。类类主要是想跟大家总结和剖析一下这些所谓的网络红人炒作的秘密和规律，鉴于最近网红的这个话题很火，我也正好借个势。\r\n</p>\r\n<p class=\"text\">\r\n	<strong>一、先说说网红炒作的几个特点</strong> \r\n</p>\r\n<p class=\"text\">\r\n	其实背后都是有规律可循的，一般有以下的共同点。\r\n</p>\r\n<p class=\"text\">\r\n	1、利用时下最新鲜的网络平台\r\n</p>\r\n<p class=\"text\">\r\n	早期主要是论坛，2010年以后主要是微博，再后来互联网分流越来越严重。朋友圈流量是大，但它毕竟是个封闭型的社区，也很难说是朋友圈捧红了谁谁谁，反倒是很多自媒体火了。\r\n</p>\r\n<p class=\"text\">\r\n	2010年是个分水岭，两家最顶级的论坛猫扑和天涯最后捧红的超级网络红人分别是奶茶MM和小月月，之后风头就被微博盖过了。\r\n</p>\r\n<p class=\"text\">\r\n	2、持续不断的一轮轮轰炸、造势、曝光\r\n</p>\r\n<p class=\"text\">\r\n	如果只是一个点，很难产生爆炸性的反应。但凡是红的越厉害的网络红人，就越不是只有一个点。\r\n</p>\r\n<p class=\"image\">\r\n	<img src=\"http://e.hiphotos.baidu.com/news/w%3D638/sign=0fbf38b8ffdcd100cd9cfb224a8a47be/aa18972bd40735fad2b5dc0c99510fb30f240839.jpg\" /> \r\n</p>\r\n<p class=\"text\">\r\n	像奶茶妹妹，从2009年的一张手捧奶茶的照片在猫扑被“笔袋男”“哥散尽全部家当求此女”曝光，到后来的上清华、绯闻\r\n男友，再到后来的奶东恋、微软“小冰“实习、大学毕业、澳大利亚结婚、怀孕，其实中间还有很多很多插曲。我记得当年，只要是她的热点，就必上头条，我们”\r\n喜欢她“就喜欢到了这种程度。\r\n</p>\r\n<p class=\"text\">\r\n	奶茶MM强到什么程度？她的内容，可以同时上娱乐频道、科技频道、数码频道、音乐频道、体育频道、社会频道、图片频道、校园频道、时尚频道、女性频道、情感频道、亲子频道等众多频道的头条，就是这么霸气！她的火，完全可以用摧枯拉朽一词来形容。\r\n</p>\r\n<p class=\"text\">\r\n	3、能红的最长久的，一定可以贴上”标签“\r\n</p>\r\n<p class=\"text\">\r\n	这点跟做新媒体账号一样，没个性的人是永远红不起来的。所谓人神合一，做的事和这人的个性是紧紧捆在一起的。\r\n</p>\r\n<p class=\"text\">\r\n	说到这标签，被用烂的标签还不行，当年”网游第一美女“一大堆，其实这个概念太宽泛，因为不可能有人占住。当很多美女都自称为”网游第一美女“的时候，这个词就废了。\r\n</p>\r\n<p class=\"text\">\r\n	当兽兽占住了”国内首席车模“、春哥占住了”春哥“的时候，这个标签就永远是他们的了。\r\n</p>\r\n<p class=\"text\">\r\n	当然标签并不是严格意义上的文字称谓，其实就是一提到某个人，你能用几个词来概括他，或者脑子里面立刻形成一个画面。比\r\n如我们想到天仙MM，就会想到那身行头，说实话，脱了那身衣服，反而我还真认不出是她。奶茶MM再怎么变，在我的脑海里，永远是拿着奶茶的那个清纯女孩。\r\n叫兽易小星当年那张A4纸的面具形象深入人心。等等等等\r\n</p>\r\n<p class=\"text\">\r\n	4、最后都会被揭秘，除非她自己不想火\r\n</p>\r\n<p class=\"text\">\r\n	但凡火了的网络红人，总会有人跳出来来揭秘，可能她的七大姑、八大爷、同学同事、大舅的弟弟的表姨的外甥女......都有可能蹦出来。在网络里，这叫“水至清则无鱼”，越浑越好。\r\n</p>\r\n<p class=\"text\">\r\n	当然，真正盖棺定论、最终立功的，永远是平媒的那些记者们。一旦被他们盯上，去她们家，真相就立刻浮出水面了。\r\n</p>\r\n<p class=\"image\">\r\n	<img src=\"http://d.hiphotos.baidu.com/news/w%3D638/sign=d8c8eed10e23dd542173a46be908b3df/c83d70cf3bc79f3deb077685bda1cd11738b29a4.jpg\" /> \r\n</p>\r\n<p class=\"image\">\r\n	<img src=\"http://d.hiphotos.baidu.com/news/w%3D638/sign=7eff4258e01190ef01fb91dcf61a9df7/b2de9c82d158ccbf974b278f1ed8bc3eb0354194.jpg\" /> \r\n</p>\r\n<p class=\"text\">\r\n	<strong>二、网红炒作，并不都是有幕后推手</strong> \r\n</p>\r\n<p class=\"text\">\r\n	当年那些红人出来，早年可不像现在，美女照片是非常稀罕的，不知道多少屌丝都是流着哈喇子看完帖子的。虽然现在看，很一般了，毕竟不同的时代，不同的欣赏水准。\r\n</p>\r\n<p class=\"text\">\r\n	2008年以后，网络美女自此泛滥了。各种各样的美女纷纷走向网络。随着PS的流行、拍摄技术的日臻完善、各种美图工具的出现，很多美女，美的连她亲妈都认不出来了。\r\n</p>\r\n<p class=\"text\">\r\n	反正我对照片，早已经麻木了，很多照片，我都能想象出来，它们没处理之前的样子。能唤起我们心灵深处那点悸动的，也只有素颜照了。素颜照万岁！\r\n</p>\r\n<p class=\"text\">\r\n	回到炒作这个话题，其实很多网红都是自然火的，人家有个性、有长相、有身材，又有独特的话题，关键是天时地利人和啊，想不火都难。我在之前的文章里说过，奶茶MM当时是有特殊网络时代背景。所以，别一提到网红，立马就说：她后面有人、她上面有人、一看就是炒作的。\r\n</p>\r\n<p class=\"text\">\r\n	这种情况下，如果真要说有幕后推手，那只能说是“媒体”了。\r\n</p>\r\n<p class=\"text\">\r\n	当然，很多网红还是有幕后推手的，有些我也认识。你也不要绝对的说人家一定有利益关系，很多还真是美女，早年的很多炒作，就是觉得好玩，或者纯粹的喜欢这个网络红人，爱你没商量，或者讨厌到极点，想拿皮带抽死你的那种意味。\r\n</p>\r\n<p class=\"text\">\r\n	归根揭底，就是网红的因素有多种，如果你不是搞研究的，乐呵乐呵也就罢了。\r\n</p>\r\n<p class=\"text\">\r\n	<strong>三、你所看到的，你以为果然如此么？</strong> \r\n</p>\r\n<p class=\"text\">\r\n	1、双重人格\r\n</p>\r\n<p class=\"text\">\r\n	其实很多人选择在网络上释放自己，归根揭底，是现实生活中缺省了一些她所不能得到的东西。很多时候，网络世界里的她和现实世界里的她，完全可能是相反的。这和人格分裂有些类似，网络世界让这个人多了一重人格。\r\n</p>\r\n<p class=\"text\">\r\n	2、但凡能红的持久的，必是智商或者情商极高的\r\n</p>\r\n<p class=\"text\">\r\n	截止到2016年，火的时间最久的，应该是芙蓉姐姐了。光是芙蓉姐姐减肥这件事上，至少就说明这个女人不简单了。我和她的前任经纪人也认识，其实我挺佩服她的。芙蓉姐姐的演唱会我去了，座位还蛮靠前的，真的很瘦。\r\n</p>\r\n<p class=\"text\">\r\n	还有一个人，我不点名字了，应该属于智商、情商奇高的人，一般的女人，能有她的一半聪明，就已经非常非常难得了。她的经历，我听幕后人讲的时候，我竟呆的哑口无言！\r\n</p>\r\n<p class=\"text\">\r\n	3、外表会蒙蔽你的双眼\r\n</p>\r\n<p class=\"text\">\r\n	其实很多网络红人之所以能红，还是跟个人的形象有关。说白了，就是能深深的刺激你内心深处的那点最脆弱的东西，比如同情心。一看那图片，就觉得有种想喂她吃竹子的冲动，她不红谁红啊？\r\n</p>\r\n<p class=\"text\">\r\n	但你真觉得她本人，真如照片上的那般娇羞动人？我用张无忌他妈殷素素在自尽前告诫张无忌的话来回答——越是漂亮的女人越会骗人，越是不能相信！\r\n</p>\r\n<p class=\"text\">\r\n	<strong>四、网红炒作的一般性流程</strong> \r\n</p>\r\n<p class=\"text\">\r\n	一般正常的、有目的性的网络事件炒作，必是经过严格而缜密的策划的。大概的流程如下：\r\n</p>\r\n<p class=\"text\">\r\n	1、发现热点\r\n</p>\r\n<p class=\"text\">\r\n	其实就是跟拍戏一样，前期需要选角色，并且量体裁衣选好剧本。其实自己捧自己也一样，papi酱之前也经过了很多次尝试啊，目的无非是找最适合自己的造型和剧本。\r\n</p>\r\n<p class=\"text\">\r\n	2、策划\r\n</p>\r\n<p class=\"text\">\r\n	策划的过程是比较难的，需要选定平台，把整个炒作的场景想象的非常周密、严丝合缝。因为基本上执行起来，100%是会出现偏差的，策划是尽可能的减少误差。\r\n</p>\r\n<p class=\"text\">\r\n	3、执行\r\n</p>\r\n<p class=\"text\">\r\n	执行过程，主要是不断的调整方向，尤其是引导舆论的方向，往对自己有利的方向去发展。凡是一个事到了网络上，很多情况是很难得到控制的，如果出现突发情况，前期的所有策划都得重新调整。甚至有时候只能用反向炒作法、双簧炒作法这些方法来“转正”。\r\n</p>\r\n<p class=\"text\">\r\n	4、轰炸、跟踪\r\n</p>\r\n<p class=\"text\">\r\n	一个事件，需要不断的挖掘新的炒作点，因为一个点很难火，一轮轰炸也不一定会火。如果出现了火的苗头，就需要想方设法那个让这个苗头变大。如果真的火了，就需要通过这个点，找到更多的话题，继续炒作，关键是方向不能走歪了。\r\n</p>\r\n<p class=\"text\">\r\n	5、揭秘、曝光\r\n</p>\r\n<p class=\"text\">\r\n	这个前面已经讲了。\r\n</p>\r\n<p class=\"image\">\r\n	<img src=\"http://e.hiphotos.baidu.com/news/w%3D638/sign=8973adfe05087bf47dec54eacad2575e/730e0cf3d7ca7bcb9ea0559ab9096b63f724a8a8.jpg\" /> \r\n</p>\r\n<p class=\"text\">\r\n	<strong>五、网红炒作的一些禁忌和注意事项</strong> \r\n</p>\r\n<p class=\"text\">\r\n	这个我看很多网络事件或者网络红人，经常犯一些错误。所以在此说一下：\r\n</p>\r\n<p class=\"text\">\r\n	1、关于创意\r\n</p>\r\n<p class=\"text\">\r\n	创意这玩意，用户的品味和口味永远是越来越高的。一个经典的创意过去，策划人下一次就又得掉更多的头发。\r\n</p>\r\n<p class=\"text\">\r\n	第一个人想到了一个巨牛逼的创意，第二个人再用，效果就会大打折扣了，这是现实。与其把过多的精力放在创意上，不如多花点时间放在整个流程的各个细节上，研究下，哪些地方可以出彩。\r\n</p>\r\n<p class=\"text\">\r\n	2、了解政策、勿碰红线\r\n</p>\r\n<p class=\"text\">\r\n	有些底线是不能碰的，比如最近直播平台发生的一些事情。低俗炒作，必然会被拖进悬崖里。还有很多党的号召、纲领，都是必须要响应、不可违背的。\r\n</p>\r\n<p class=\"text\">\r\n	这样，即使是红了，那么这个网红产生的品牌效应，也是负分的，负分意味着产生的价值是极其有限的，寿命也必然是有限的。\r\n</p>\r\n<p class=\"text\">\r\n	3、适可而止，永远给自己留一条后路\r\n</p>\r\n<p class=\"text\">\r\n	凡事别做绝了，有些网络红人，为了红，直接把自己给封死了。或者因为个人的人品、道德，得罪了同行，得罪了朋友。或者红了之后，觉得自己牛逼闪闪放光芒，不可一世。网络世界永远都是虚的，媒体把你捧的越高，当你摔下来的时候，也越惨。\r\n</p>\r\n<p class=\"text\">\r\n	当然，我也对那种看人家红了眼红，冷嘲热讽吐口水、口蜜腹剑丢砖头的人，非常不齿。像“大衣哥”朱之文火了，有人连找不到媳妇都认为朱之文应该借钱帮忙，这实在是......凭什么啊？\r\n</p>\r\n<p class=\"text\">\r\n	4、分清虚拟世界和现实世界\r\n</p>\r\n<p class=\"text\">\r\n	自己有几把刷子，自己知道。其实有些人，天生没有多少资质，想火不择手段，实在没必要。其实做个普通人、现实人也挺好的，出名了，反而会给生活造成很大不必要的麻烦。\r\n</p>\r\n<p class=\"text\">\r\n	这些年，网红里面女性比例是远远大于男性比例的，悬殊的还不是一点两点。我见过有些帅哥，真的是帅的让人羡慕嫉妒恨，还有些皮肤好的比女生还好，但就是火不起来，实在没办法啊！\r\n</p>\r\n<p class=\"text\">\r\n	5、水军不同于网络推手\r\n</p>\r\n<p class=\"text\">\r\n	我一直觉得水军是个贬义词，水军的目的实在太强了，除了钱还是钱，所以能做出经典的案例，难上加难。如果你为了钱，才创业，那你失败的几率会很大，因为初衷已经走形了。网红炒作亦是，一开始就奔着发财的梦去的，往往发不了财。\r\n</p>\r\n<p class=\"text\">\r\n	网络炒作也一样，大家仔细观察下这10年最火的一些网红就会发现，很多其实并不会产生很大的金钱的，至少在他们火的时候，是不会产生太大金钱的。\r\n</p>\r\n<p class=\"text\">\r\n	当年的很多水军都已经转型，还有一个原因确实是控制网络舆论，其实就是不关注用户感受嘛，这样做出的“产品”，效果难保\r\n不好！网络推手，当年我们认为还是一个挺高雅的词，至少我还是认为，只有能做出经典案例、在互联网上产生广泛的口碑和影响的策划人，才能称得上是网络推\r\n手。现在这个词，好像也有被玩烂的趋势。\r\n</p>\r\n<p class=\"text\">\r\n	<strong>总结</strong> \r\n</p>\r\n<p class=\"text\">\r\n	今天，先说这么多。开这个话题，一则是回想起这个话题，颇感惆怅，有感而发，二则是跟大家说一说这里面的一些门道，大家如果觉得有用，可以记下。\r\n</p>\r\n<p class=\"text\">\r\n	网红，不是你想红就能红；网红炒作，也不是你想做就能做的。抛开这个背后，我觉得更重要的是过程中，我们得到了什么。感谢互联网给我们带来了这么多喜怒和哀乐！\r\n</p>', '网红', '网络红人至少有10年以上的历史了，从最早的天仙MM、芙蓉姐姐、二月丫头、木子美等等，到网络小胖、程琳、\r\nayawawa、小龙女彤彤、孔燕松、犀利哥、兽兽、凤姐等等，再到奶茶MM、papi酱等等，这些', '1', '0', '管理员', '2016-03-09 00:00:00', '', '', 0, 0, NULL, NULL),
(3, 12, ' 教你智斗奸商 真假iPhone鉴别终极大招', '', '网易新闻', '2016-03-08 00:00:00', '<p>\r\n	在文章的开始，我们先来了解一下，什么是翻新机、水货机以及改装机。\r\n</p>\r\n<p>\r\n	<strong>翻新机</strong>：回收的二手手机通过维修或者化学液体进行清理等，重新更换新的手机外壳、外包装及其配件，然后当做新机进行售卖，质量无法保证。\r\n</p>\r\n<p>\r\n	<strong>水货机</strong>：指在某国家或地区没有经过原生产厂家所指定的销售代理而进行销售的产品。但现如今绝大多数的水货手机都是通过二手水货手机翻新而来。\r\n</p>\r\n<p>\r\n	<strong>改装机</strong>：\r\n在市面上出现的iPhone改装机通常是iPhone&nbsp;5/5c改装成iPhone&nbsp;5s以及iPhone&nbsp;6/6&nbsp;Plus改装成iPhone&nbsp;6s\r\n/6s&nbsp;Plus（iPhone&nbsp;SE刚刚发布，笔者认为日后iPhone&nbsp;5/5c/5s改装成iPhone&nbsp;SE会大批现身），改装机通常在外观做改\r\n动，使其外观与“原机”一致。（改装机使用外观相似的“老iPhone主板”，是在翻新机的基础上进一步压缩成本。）\r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/5/56/56A3E4FAA669DC4427EF486349A42ACD.jpg\" /><br />\r\n<strong>教你智斗奸商&nbsp;真假iPhone鉴别终极大招</strong> \r\n</p>\r\n<p>\r\n	现\r\n如今手机实体商店遍地都是，网络手机商家更是让人眼花缭乱，水货、改装机、翻新机琳琅满目，真假难辨。早在一年前，有关于iPhone&nbsp;5/5c改装成\r\niPhone&nbsp;5s进行售卖的事件屡屡出现，但iPhone&nbsp;5/5c改装成iPhone&nbsp;5s一个无法解决的缺陷就是“没有指纹”，可是这个缺陷在\r\niPhone&nbsp;6改iPhone&nbsp;6s上不复存在，iPhone&nbsp;6s外观与iPhone&nbsp;6对比，只有细微的差别，但可以通过更换手机壳来抹平；另一个\r\n最大区别3D&nbsp;Touch完全可通过<a href=\"http://m.163.com/android/software/2vc519.html\" target=\"_blank\">越狱</a>安装插件来搞定。如此一来，你还能分辨出这是改装后的iPhone&nbsp;6吗？\r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/6/69/699DF882384F6AE3108F5096A7E21E1C.jpg\" /><br />\r\n<strong>iPhone&nbsp;6s的模仿者-iPhone&nbsp;6（图片引自新浪微博）</strong> \r\n</p>\r\n<p>\r\n	此前，一网友在某电子城就买了改装机的iPhone&nbsp;6s，在后期使用中陆续<a href=\"http://m.163.com/android/software/2vnl2f.html\" target=\"_blank\">发现</a>一\r\n些疑问，但通过查询手机IMEI码并未发现问题，随后送到苹果授权的售后“百邦”进行检测，百邦服务报告单诊断结果显示：该手机未经授权改装，IMEI恢\r\n复后与登记不符，主机为iPhone&nbsp;6。其实这样的案例已屡见不鲜，我们身边的朋友可能也遭受过这样的经历，难道我们真的无法辩这些翻新机/改装机吗？\r\n答案当然是“No”。下面笔我们来看看都可通过哪些方法来鉴别真假iPhone。\r\n</p>\r\n<a name=\"p2\"></a> \r\n<p>\r\n	<b>真假Phone鉴别终极大招（上）</b> \r\n</p>\r\n<p>\r\n	<strong>一、外包装和使用说明书</strong> \r\n</p>\r\n<p>\r\n	<strong></strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<strong><img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/F/F0/F08F3E565E6789706CE3E01A6012A814.jpg\" /></strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<strong><img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/7/78/78B6250F5D6BBF4514A3F345086281E6.jpg\" /></strong> \r\n</p>\r\n<p>\r\n	<strong>iPhone真假包装对比</strong> \r\n</p>\r\n<p>\r\n	正规iPhone的包装和说明书印刷精美，字体和图像清晰、有层次感，假冒包装盒却多为简单单面纸张仿造，字体和图像等都相对模糊。\r\n</p>\r\n<p>\r\n	<strong>二、外壳及螺丝</strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/B/BF/BFAB19F4ED85812BED7E2C84A65ACAF7.jpg\" /><br />\r\n<strong>检查iPhone外壳<strong>及螺丝</strong></strong> \r\n</p>\r\n<p>\r\n	拆\r\n开全新的iPhone包装时会很明显地注意到，在机器“关键部位”都有贴膜做重点防护，通常被翻新的iPhone，都会留下一些触摸过的痕迹。此外，灰尘\r\n和使用痕迹也是翻新机器难以避免的。机器上下外壳之间的缝隙是容易“藏污纳垢”的，另外查看机身螺丝是否崭新，有没有螺丝刀拧动过的痕迹，所以这些细节部\r\n分也是鉴定翻新机的重要手段。\r\n</p>\r\n<p>\r\n	<strong>三、数据线及耳机接口</strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/7/7B/7BD22D13A8E61392F196DA26E9162466.jpg\" /><br />\r\n<strong>检查iPhone耳机接口与USB接口有无划痕</strong> \r\n</p>\r\n<p>\r\n	翻新iPhone的数据线插口（尾插）使用的并非全新的，通常会使用一些旧手机的零配件，由于数据线、耳机长期插拔的缘故，所以有些翻新机USB接口、耳机接口会出现难以消除的黑色划痕。\r\n</p>\r\n<p>\r\n	<strong>四、手机配件</strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/C/C9/C9CFCFACB44ED66B21E80EBE6C3F3707.jpg\" /> \r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/C/C6/C6DBFFB71F0696997EEFA44C30507E9A.jpg\" /><br />\r\n<strong>iPhone&nbsp;真假配件对比</strong> \r\n</p>\r\n<p>\r\n	全新的iPhone有全套的原厂配件，翻新手机的配件一般都不齐全或者不是原厂的，购机之前最好先去相关的网站了解一下标配的原厂配件都有哪些。另外，如果<a href=\"http://m.163.com/android/software/2vnl2f.html\" target=\"_blank\">发现</a>配套的充电器和耳机的插头上有划痕的话，那么这台手机也很有可能是被做过手脚的。\r\n</p>\r\n<p>\r\n	<strong>五、价格</strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/7/71/7104FF9989A2A01905AA7C1D557A008E.jpg\" /> \r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/1/16/168E33A2B2CF364CB9380CD339F0A9AE.jpg\" /><br />\r\n<strong>iPhone&nbsp;6国行与水货价格对比（图片引自京东商城/淘宝网）</strong> \r\n</p>\r\n<p>\r\n	由于翻新机的零配件多为早期产品，质量也差，所以价格相对较低。要是遇到价格低得离谱而商家却称之为水货的手机，基本可以断定为翻新机。大家应尽量在正规经销商处购买，建议大家购买手机前最好进入京东等电商<a href=\"http://mall.163.com\">商城</a>查看最低报价，相差过大则很可能是翻新机/改装机。\r\n</p>\r\n<a name=\"p3\"></a> \r\n<p>\r\n	<b>真假Phone鉴别终极大招（下）</b> \r\n</p>\r\n<p>\r\n	<strong>六、闻新手机开箱味道</strong> \r\n</p>\r\n<p>\r\n	<strong></strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<strong><img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/E/EB/EBAFB03B36D861CECB1B0236744877C4.jpg\" /></strong> \r\n</p>\r\n<p>\r\n	<strong>维修过的iPhone通常有刺鼻的化学味道</strong> \r\n</p>\r\n<p>\r\n	大多数新机器有种电子产品出厂时所特殊的气味，这种气味绝不是普通<a href=\"http://m.163.com/iphone/software/2vmma5.html\" target=\"_blank\">香水</a>所能模仿的；而旧机器和换壳机一般都没有这样的味道，可能还留下维修改装时化学材料的味道。\r\n</p>\r\n<p>\r\n	<strong>七、体验通话质量</strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/E/ED/EDC88DAF846C65403644261B01E68233.jpg\" /><br />\r\n<strong>iPhone通话出现杂音等情况一定是“假冒”iPhone（图片引自The&nbsp;Verge）</strong> \r\n</p>\r\n<p>\r\n	当我们去选购手机时，应自带SIM卡试机。打电话给你的朋友，询问对方通话质量如何，通话声音是否清晰，有无杂音或电流声，音量大小有无骤然下降的现象。\r\n</p>\r\n<p>\r\n	<strong>八、看保修</strong> \r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/C/CB/CB09AF62FD9CB0CDD4554E098FF9BBF8.jpg\" /><br />\r\n<strong><strong>购买</strong>iPhone&nbsp;4s开具的发票（图片引自新浪微博）</strong> \r\n</p>\r\n<p>\r\n	正\r\n规经销商都会主动开具发票，并能享受全国三包的服务。翻新机无法享受正规手机“三包”规定的所有权益，因此一般没有保修期或保修期相对较短。如果销售商说\r\n他们自己负责保修，这样的手机是不能购买的，因为正规手机一般都是全国联保的。如果销售商无法做到这些，那么手机肯定存在问题。\r\n</p>\r\n<p>\r\n	<strong>九、查看手机IMEI码及序列号</strong> \r\n</p>\r\n<p>\r\n	IMEI(International&nbsp;Mobile&nbsp;Equip<a href=\"http://m.163.com/iphone/software/2vj301.html\" target=\"_blank\">me</a>nt&nbsp;Identity)&nbsp;是国际<a href=\"http://mall.163.com/mobile/fill.html\">移动</a>设备身份码的缩写，国际移动装备辨识码，是由15位数字组成的“电子串号”，它与每台手机一一对应，而且该码是全世界唯一的。每一只手机在组装完成后都将被赋予一个全球唯一的一组号码，这个号码从生产到交付使用都将被制造生产的厂商所记录。\r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/4/4D/4D9427696385D1BBD8EB951FDA3C9AA5.jpg\" /><br />\r\n<strong>图为&nbsp;iPhone&nbsp;6参数</strong> \r\n</p>\r\n<p>\r\n	其组成为1234<a href=\"http://m.163.com/iphone/software/2vh9e5.html\" target=\"_blank\">56</a>-78-901234-5:&nbsp;前\r\n6位数是“型号核准号码”，一般代表机型；7&nbsp;、8位数是“最后装配号”，一般代表产地；之后的6位数是“串号”，一般代表生产顺序号；最后1位数通常是\r\n为检验码。IMEI码在手机背面的标志上，并且读写于手机内存中。它也是该手机在厂家的“档案”和“身份证号”。\r\n</p>\r\n<p>\r\n	大家都知道iPhone的IMEI与序列号是对应的，N码合一是iPhone激活条件之一。我们可以通过相关查询网站对iPhone的IMEI码进行查询，即可得到iPhone的序列号、购买日期以及激活日期等信息，进行核对就可鉴别该机的真实身份。\r\n</p>\r\n<p>\r\n	iPhone相关信息查询网站：&nbsp;【链接1】&nbsp;【链接2】&nbsp;【链接3】&nbsp;【激活锁查询链接】\r\n</p>\r\n<p>\r\n	通常查询iPhone&nbsp;IMEI码对应的信息是鉴定手机是否是翻新机、改装机的最好方法；但市面上的iPhone改装机通常会使用<a href=\"http://m.163.com/android/software/2vc519.html\" target=\"_blank\">越狱</a>装\r\n插件或相应设备，对手机【设置】内的IMEI码及相关信息进行随意修改，多数都会更改为“高保修的iPhone”信息。在此情况下，如果我们在对【设置】\r\n内的IMEI码进行信息查询，得到的信息显然与该机真实信息不符的。既然这样，我们该如何准确辨别真假iPhone呢？\r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"傻傻分不清楚 如何识破假冒的iPhone \" src=\"http://img1.cache.netease.com/catchpic/B/BE/BEEF23ED31BD58DB57A8158541D4D2A2.jpg\" /><br />\r\n<strong>查询iPhone原始序列号</strong> \r\n</p>\r\n<div class=\"gg200x300\">\r\n</div>\r\n<p>\r\n	通常奸商更改的只是【设置】内显示的信息，原始序列号是奸商无法更改的，查询iPhone原始序列号是鉴定改装iPhone最有效的大\r\n招。那么如何才能找到iPhone原始序列号呢？首先需要使用PC端的iTunes软件，然后将iPhone连接PC端，将iPhone进入恢复模式，进\r\n入恢复模式后我们就能查看该手机真实的序列号，将此序列号与【设置】内的序列号进行对比，即可鉴别是否是改装机。\r\n</p>\r\n<p>\r\n	<strong>笔者总结：</strong> \r\n</p>\r\n<p>\r\n	手机跟我们生活密切相关，不管是价格昂贵的还是便宜的，正品行货都很少会出现问题，而翻新机、改装机等则会存在辐射大、易坏、易发热、易爆炸等危害，所以购买手机一定要学会辨别真伪，避免很多不可预测的人身危险。\r\n</p>\r\n<p>\r\n	奸商五花八门的手段也随着产品的更新换代而不断更换，除了以上这些方法以外，一定要谨记的是，商品时代有一条亘古不变的定律：一分价钱一分货，贪小便宜吃大亏。\r\n</p>', 'Iphone，真伪', '在文章的开始，我们先来了解一下，什么是翻新机、水货机以及改装机。翻新机：回收的二手手机通过维修或者化学液体进行清理等，重新更换新的手机外壳、外包装及其配件，然后当做新机进行售卖，质量无法保证。水货机：', '1', '0', '管理员', '2016-03-09 00:00:00', '', '', 0, 0, NULL, NULL),
(4, 3, '360回应木马获免杀认证：将重拳打击', '', '网易新闻', '2016-03-01 00:00:00', '<div class=\"otitle\">\r\n	（原标题：360回应木马实现免杀认证：杜绝此类事件再次发生）\r\n</div>\r\n<p>\r\n	【TechWeb报道】3月24日消息，央视财经频道《经济与法》栏目曝光了一起新型木马病毒盗窃<a href=\"http://tech.163.com/company/alipay/\">支付宝</a>资金案。\r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"木马获“免杀”认证 360称将杜绝再发生\" src=\"http://img5.cache.netease.com/tech/2016/3/24/2016032412142939a33.jpg\" /> \r\n</p>\r\n<p>\r\n	犯罪嫌疑人主要针对<a href=\"http://tech.163.com/company/taobao/\">淘宝</a>商家，以询问有没\r\n有这样的商品为理由，向淘宝卖家发送伪装成照片的exe木马程序，卖家只要点开图片，木马就被装到电脑里。犯罪嫌疑人购买商品后，以不合适为由找商家退\r\n款，商家接受退款申请并输入支付宝密码的时候，木马的后台程序就自动把支付宝密码记录了下来。于是，犯罪嫌疑人直接登录淘宝卖家的支付宝，转走其账户余\r\n额。\r\n</p>\r\n<p>\r\n	用户可能会质疑，exe木马程序不是会被杀毒软件杀掉吗？据央视报道，该犯罪嫌疑人所使用的木马病毒并不能被<a href=\"http://tech.163.com/company/360/\">360</a>杀毒软件杀掉，原因是该木马病毒申请了360的免杀认证。\r\n</p>\r\n<p>\r\n	据犯罪嫌疑人交代，软件公司开发出来的每一个软件都要做360免杀认证，有一些公司利用这种便利给其木马病毒也做免杀认证，认证一次一千元。有了这\r\n个认证后，木马病毒便可以在装了360软件的电脑中畅行无阻了。今年年初，遭遇此类盗窃的淘宝卖家达19个，损失最多的一笔高达三万多，最少的只有七百多\r\n元。\r\n</p>\r\n<p>\r\n	根据央视报道，这种新型网络盗窃手段已经形成产业链。有人负责卖此类木马病毒，价格为2万元，有人负责认证，有人负责拉单实施诈骗。温州市瑞安市警方破获了该案件，相关的犯罪嫌疑人被判处一年到三年不等的有期徒刑。\r\n</p>\r\n<p>\r\n	央视提醒用户，大家尽量不要在其他人的电脑上登陆一些涉及自己资金的银行卡账号，或者支付宝账号。不要随意打开陌生人发过来的一些文件，此外一些陌生的扫二维码的东西，其实也是下载病毒的一个过程。（明宇）\r\n</p>\r\n<p>\r\n	【TechWeb报道】3月24日消息，央视《经济与法》栏目报道犯罪分子利用木马窃取网店商家钱财事件，报道提及犯罪分子以1000元每单贿赂厦门一家软件公司的员工，将木马混入该公司的正常软件中，提交给360进行安全认证实现\"免杀\"。\r\n</p>\r\n<p class=\"f_center\">\r\n	<img alt=\"木马获“免杀”认证 360称将杜绝再发生\" src=\"http://img4.cache.netease.com/tech/2016/3/24/2016032412070497f98.jpg\" /> \r\n</p>\r\n<p>\r\n	360对此进行了回应，回应称，360软件安全认证是为合法企业和开发者提供的免费服务，目的是避免正规软件在更新升级后遭到误报。在360进行软\r\n件安全认证的企业必须具有营业执照、文化部网络文化经营许可证及工信部网站备案资质。一旦出现被木马利用的行为，360会配合公安机关对其进行重拳打击。\r\n</p>\r\n<p>\r\n	360表示，对此类非法行为，我们已加强监管措施，遵循\"实名认证 技术检测 用户举报\"的基本原则，通过多重审核、人工分析、定期回查等措施杜绝此类事件的再次发生。（明宇）\r\n</p>\r\n<p>\r\n	以下为360公司回应全文：\r\n</p>\r\n<p>\r\n	1、对合法软件进行安全认证是国内外安全厂商的通行做法。360软件安全认证是为合法企业和开发者提供的免费服务，目的是避免正规软件在更新升级后\r\n遭到误报。在360进行软件安全认证的企业必须具有营业执照、文化部网络文化经营许可证及工信部网站备案资质。一旦出现被木马利用的行为，360会配合公\r\n安机关对其进行重拳打击，犯罪分子必将遭到法律严惩。\r\n</p>\r\n<p>\r\n	2、 \r\n2014年底，一家名为\"厦门盛游网络科技有限公司\"的员工，在接受犯罪分子贿赂后，把木马混入该公司旗下的\"801游戏客户端\"提交给360软件安全认\r\n证平台实现免杀。对此类非法行为，我们已加强监管措施，遵循\"实名认证 技术检测 \r\n用户举报\"的基本原则，通过多重审核、人工分析、定期回查等措施杜绝此类事件的再次发生。\r\n</p>\r\n<p>\r\n	3、 \r\n自360从2010年发布人工智能病毒查杀引擎QVM以后，木马的生存空间被极大地压缩，于是滋生了利用贿赂第三方软件公司员工的方式，借道合法软件免\r\n杀。360对此始终保持高压打击，并推出网购先赔，鼓励用户举报，承诺用户如因木马造成财产损失，360公司会进行现金赔偿，保证用户权益不受损害。今\r\n后，360将和公安机关展开更紧密的合作，对一切网络犯罪行为严打到底。\r\n</p>\r\n<img alt=\"木马获“免杀”认证 360称将杜绝再发生\" src=\"http://img5.cache.netease.com/tech/2016/3/24/201603241209446665d.png\" />', '360 木马', '（原标题：360回应木马实现免杀认证：杜绝此类事件再次发生）【TechWeb报道】3月24日消息，央视财经频道《经济与法》栏目曝光了一起新型木马病毒盗窃支付宝资金案。犯罪嫌疑人主要针对淘宝商家，以询问', '1', '0', '作者', '2016-03-09 00:00:00', '', '', 0, 0, NULL, NULL),
(9, 20, '第1章  绪言 ', '', '田礼成', '2018-04-18 00:00:00', '<p class=\"MsoNormal\" align=\"left\" style=\"text-align:left;background:white;\">\r\n	<br />\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">1. 什么是信息</span></strong>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp; </span><span style=\"font-size:14px;\">信息是客观事物存在的第</span><span style=\"font-size:14px;\"></span><span style=\"font-size:14px;\">三种基本形态，也是区别于物质与能量的第三类资源。信息可以用来消除客观事物的不确定性，从而帮助人们解决问题、科学决策，指导人们的行动。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp; <span style=\"background-color:#009900;\">信息学奠基人香农</span>认为：信息是“用来消除不确定的东西”。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp; <span style=\"background-color:#009900;\">控制论奠基人维纳</span>：信息是区别于物质与能量的第三类资源。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp; <span style=\"background-color:#009900;\">我国信息论专家钟义信</span>提出：信息是“事物运动的状态与方式”。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>&nbsp;2. 信息的主要</strong><span style=\"background-color:;\"><strong></strong></span><strong>特征</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;◇ 普遍性◇ 依附性◇ 共享性◇ 价值性 ◇ 时效性</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp;<strong>3. 什么是信息技术</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;信息技术（Information Technology， IT）是指在信息的获取、整理、加工、存储、传递和利用过程中所采用的技术和方法。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">现代信息技术包括微电子技术、计算机技术、通信技术、控制技术、网络技术、存储技术等等，其中微电子技术是基础，计算机技术是核心。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>&nbsp;4. 信息技术的历史</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;自从人类诞生以来，信息技术已经经历了五次革命。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;（1）第一次信息技术革命是语言的产生。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;（2）第二次信息技术革命是文字的发明。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;（3）<span style=\"background-color:#009900;\">第三次信息技术革命是造纸术和印刷术的发明</span>。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;（4）第四次信息技术革命是电报、电话、广播、电视的发明和普及应用。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;（5）第五次信息技术革命：电子计算机的普及使用和计算机与通信技术的结合。</span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '信息，信息技术', '1.什么是信息&nbsp;&nbsp;信息是客观事物存在的第三种基本形态，也是区别于物质与能量的第三类资源。信息可以用来消除客观事物的不确定性，从而帮助人们解决问题、科学决策，指导人们的行动。&nbs', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL),
(10, 20, '第2章  信息获取', '', '田礼成', '2018-04-18 00:00:00', '<p>\r\n	<span style=\"font-size:14px;\"><strong>1. 网络信息检索</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;因特网上有一种非常有效的信息搜索工具——搜索引擎。利用搜索引擎获取信息有两种主要方式:目录检索和关键词查询。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp;&nbsp;&nbsp;⑴目录检索：使用目录检索网站有yahoo（雅虎）、sina（新浪）、sohu（搜狐）、163（网易）。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;目录检索无需输入任何文字，只要根据目录搜索引擎提供的主题分类目录，层层点击进入，便可查找到所需的网络信息资源。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;⑵关键词查询。使用关键词查询服务的有：google（谷歌）、Baidu（百度）AltaVista、Lycos等。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关键词查询是指利用指定的关键词来查找信息的方法。一般情况下，使用关键词查询可以准确地找到与该关键词匹配的信息。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; 用关键词查询法查找信息，需要先提炼关键词，恰当地组合关键词优化搜索结果，加快检索速度。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">组合关键词的运算符的意义：</span><span style=\"font-size:14px;\">&nbsp; &nbsp;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"> \r\n	<table style=\"width:50%;\" cellpadding=\"7\" border=\"1\" bordercolor=\"#64451D\">\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					<span style=\"font-size:14px;\">AND或“＋”或“安空格”　表示必须同时符合所列出的关键词</span><br />\r\n				</td>\r\n				<td>\r\n					<span style=\"font-size:14px;\">例子：既含有“鲜花”又含有“玫瑰”</span><br />\r\n				</td>\r\n				<td>\r\n					<span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">鲜花 AND 玫瑰　或　鲜花＋玫瑰　鲜花（空格）玫瑰</span><br />\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					<span style=\"font-size:14px;\">OR或“｜”表示只需符合列出关键词中的一个</span><br />\r\n				</td>\r\n				<td>\r\n					<span style=\"font-size:14px;\">例子：含有“鲜花”或者含有“玫瑰”</span><br />\r\n				</td>\r\n				<td>\r\n					<span style=\"font-size:14px;\">&nbsp;鲜花 OR 玫瑰　　鲜花｜玫瑰</span><br />\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					<span style=\"font-size:14px;\">NOT或“－”表示把含有该关键词的排除在外</span><br />\r\n				</td>\r\n				<td>\r\n					<span style=\"font-size:14px;\">例子：含有“鲜花”或者含有“玫瑰”</span><br />\r\n				</td>\r\n				<td>\r\n					<span style=\"font-size:14px;\">&nbsp;鲜花 NOT 玫瑰　　鲜花－玫瑰</span><br />\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n<br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>2. 信息价值的判断</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">信息价值的判断从以下五个方面进行：</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">◇ 信息的准确性 &nbsp; &nbsp;◇ 信息的客观性 &nbsp; &nbsp;◇ 信息的权威性 &nbsp; &nbsp; ◇ 信息的时效性 &nbsp; &nbsp; &nbsp;◇ 信息的适用性</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '网络信息检索', '1.网络信息检索&nbsp;&nbsp;因特网上有一种非常有效的信息搜索工具——搜索引擎。利用搜索引擎获取信息有两种主要方式:目录检索和关键词查询。&nbsp;&nbsp;&nbsp;⑴目录检索：使用', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL),
(11, 20, '第3章  信息加工与表达', '', '田礼成', '2018-04-18 00:00:00', '<p>\r\n	<span style=\"font-size:14px;\"><strong>1. 信息的加工</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">信息加工包括以下几个方面：</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">◇	信息加工的需求确定</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">◇	文本信息的加工：word、wps &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ◇数据信息的加工：excel 金山表格</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">◇	图片信息的加工：Photoshop &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ◇声音信息的加工： Goldwave 录音大师</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">◇	视频信息的加工：Premiere 绘声绘影。 ◇动画信息的加工：Flsah、3D Studio</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">◇	网页信息加工：FrontPage、Dreamweaver</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">◇	各种信息类型常见文件格式：</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">类型	格式后缀名	适用软件</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">文本文件	*.txt	纯文本文件，可被大多数字处理软件识别</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.doc	字处理软件Word生成的文档文件</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.rtf	多文本格式，能被许多软件Wps、Word、Execl识别</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">声音文件	*.wav	该格式文件记录的是声音波形，和原声基本一致</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.midi	存放“乐器数字接口”信息的标准文件</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.mp3</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.ra	广泛应用于网络</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.wma	微软推出的与mp3齐名</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">图像文件	*.bmp	Windows中使用的标准图像格式，常用于壁纸</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.jpeg	应用广泛的图片格式，数码相机常用格式</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.tiff	图像文件的一种</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.gif	多应用于网页中，很多小动画都是GIF格式</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.png</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.psd	图像处理软件PhotoShop所特有的图像文件格式</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.cdr	著名图形设计软件CorelDRAW的专用格式</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">视频文件	*.avi	图像质量好　但文件太大</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.mpeg *.mpg *.dat	VCD、DVD和（MPEG-4，可供网上观看）</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.wav	一种流媒体文件格式，可边下载边播放</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.rm	常用RealPlay播放器播放，在低速网上实时传输视频</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">网页文件	*.html &nbsp;*.htm	普通网页文件</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.asp	微软开发的动态网页技术</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.jsp	跨平台执行的脚本语言，在服务端产生动态网页</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">*.php	跨平台执行的脚本语言，在服务端产生动态网页</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>2. 信息的集成与交流</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;将文本、图、声音、视频和动画等多种媒体素材，有机地组织起来，形成多媒体作品的过程称为信息的集成。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;● 信息集成的一般过程</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;确定作品主题——规划设计作品——采集处理素材——制作加工作品——测试发布作品</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;● 信息的发布与交流</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;信息发布与交流的目的，就是将自己的想法通过一定的传播途径让他人知晓。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;信息发布与交流的方式多种多样，生活中人们常常通过面谈、演讲、书刊杂志、电视、广播、广告等方式发布与交流信息。随着信息技术的发展，电子邮件（e-mail）交流、会议演示（PPT）、网站发布、在线交流（QQ、MSN）、BBS等也成为了信息发布与交流的流行方式。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>3. 编程解决问题和智能信息处理</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;● 用计算机进行信息处理的基本方法</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;有两种基本方法：一是利用现有的软件（已经编好的程序）让计算机工作，二是自己编制计算机程序，让计算机为自己服务。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;● 编程解决问题</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;编制计算机程序解决问题的过程包括：分析问题、设计算法、编写程序、调试运行等。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;程序是控制计算机动作的指令的记录集合。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp; &nbsp;算法就是解决问题的步骤集合，可以被表述和实现。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><u>应用软件中：</u><strong><u>CAI</u></strong><u>（计算机辅助教学） </u><strong><u>CAD</u></strong><u>（计算机辅助设计） </u><strong><u>CAM</u></strong><u>（计算机辅助制造）</u></span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '加工', '1.信息的加工信息加工包括以下几个方面：◇信息加工的需求确定◇文本信息的加工：word、wps&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;◇数据信息的加工：excel金山表格◇图片信息', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL),
(12, 20, '第4章 信息资源管理', '', '田礼成', '2018-04-18 00:00:00', '<p>\r\n	1. 信息资源管理的目的\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp;信息是一种资源。\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp;● 身边的信息资源管理\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp;在信息活动日益广泛的今天，不论是个人工作和生活，还是企事业单位的事务处理，都在不同程度的对信息资源进行着管理。\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp;● 信息资源管理的目的\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp;信息资源管理的目的就是为了确保信息资源的有效利用。\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp;2. 信息资源管理的方式\r\n</p>\r\n<p>\r\n	人们经常用到的信息资源管理方式主要有手工管理、计算机管理等两种。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	3. 使用数据库管理信息的基本思想与方法\r\n</p>\r\n<p>\r\n	● 数据库的组成\r\n</p>\r\n<p>\r\n	数据库是由若干个二维表组成的。在数据库中，表的结构由字段组成，每一行中所有字段组合起来的数据，便是一个完整的“记录”，集合所有的记录，就形成了“表”。\r\n</p>\r\n<p>\r\n	● 数据库的管理\r\n</p>\r\n<p>\r\n	对数据库的管理，包括建立和删除数据文件，检索、统计、修改和组织数据库中的数据等，是通过数据库管理系统实现的。\r\n</p>\r\n<p>\r\n	◇ 数据的增加与删除\r\n</p>\r\n<p>\r\n	在一个数据库中，对所有符合条件的记录进行增加或删除的操作。 &nbsp; &nbsp; &nbsp;\r\n</p>\r\n<p>\r\n	◇ 数据的查询\r\n</p>\r\n<p>\r\n	在一个数据库中，对所有符合条件的记录进行搜索，称为查询。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '信息资源管理', '1.信息资源管理的目的&nbsp;&nbsp;信息是一种资源。&nbsp;&nbsp;●身边的信息资源管理&nbsp;&nbsp;在信息活动日益广泛的今天，不论是个人工作和生活，还是企事业单位的事务处', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL),
(13, 20, '第5章 信息技术与社会', '', '田礼成', '2018-04-18 00:00:00', '<p>\r\n	1. 计算机病毒\r\n</p>\r\n<p>\r\n	病毒 (virus) 是生物学领域的术语，是指能够使人或动物致病的一种微生物。计算机病毒，是指编制或者在计算机程序中插入的破坏计算机功能或者毁坏数据，影响计算机使用，并能自我复制的一组计算机指令或者程序代码。\r\n</p>\r\n<p>\r\n	计算机病毒的特性：潜伏性、传染性、复制性、攻击性和破坏性。\r\n</p>\r\n<p>\r\n	常见的病毒：CIH 熊猫烧香、爱虫，蠕虫、冲击波、木马等。\r\n</p>\r\n<p>\r\n	常见的杀毒软件：金山毒霸、瑞星、卡巴斯基、江民、诺顿等\r\n</p>\r\n<p>\r\n	我国相应的法律法规：\r\n</p>\r\n<p>\r\n	2000年4月26日颁发了《计算机病毒防治管理办法》（中华人民共和国公安部第51号令）。\r\n</p>\r\n<p>\r\n	1994年2月18日正式颁布实施《中华人民共和国计算机信息系统安全保护条例》。\r\n</p>\r\n<p>\r\n	新《刑法》第286条第3款也对实施制作、传播计算机病毒等破坏性程序的人作出了判刑规定。\r\n</p>\r\n<p>\r\n	◇ “共享”与“尊重” &nbsp; &nbsp; ◇ “自由”与“规则” &nbsp; ◇ “虚拟”与“现实”\r\n</p>\r\n<p>\r\n	2．信息技术与青少年\r\n</p>\r\n<p>\r\n	● 合理利用信息技术 &nbsp; &nbsp;● 自觉遵守信息社会的法律、规范和道德\r\n</p>\r\n<p>\r\n	◇ 尊重他人的知识产权：◇ 加强自我约束\r\n</p>\r\n<p>\r\n	● 加强自我保护意识，提高自我保护能力\r\n</p>\r\n<p>\r\n	◇ 加强病毒防范的意识和能力 &nbsp; ◇ 保护自己的作品\r\n</p>\r\n<p>\r\n	◇ 避免网络陷阱的伤害 &nbsp; &nbsp; &nbsp; &nbsp; ◇ 警惕信息污染\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '信息技术与社会', '1.计算机病毒病毒(virus)是生物学领域的术语，是指能够使人或动物致病的一种微生物。计算机病毒，是指编制或者在计算机程序中插入的破坏计算机功能或者毁坏数据，影响计算机使用，并能自我复制的一组计算机', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL),
(14, 26, '第1章　走进网络世界', '', '田礼成', '2018-04-18 00:00:00', '<p>\r\n	※　计算机网络及其主要功能\r\n</p>\r\n<p>\r\n	计算机网络：是利用通信设备和线路（有线的或无线的），将地理上分散分布的具有独立功能的多台计算机相互连接，以功能完善的网络软件实现网络中资源共享和信息传递的系统。\r\n</p>\r\n<p>\r\n	计算机网络有四大功能：数据传送、资源共享、提高计算机的可靠性和可用性与分布处理。\r\n</p>\r\n<p>\r\n	※　计算机网络的分类\r\n</p>\r\n<p>\r\n	计算机网络有多种分类标准。最常用的按网络覆盖范围（作用范围）划分：局域网（LAN）、城域网(MAN)、广域网(WAN)。（分并没有严格定量的规定，只是一个大致的概念）\r\n</p>\r\n<p>\r\n	※　计算机网络的组成\r\n</p>\r\n<p>\r\n	◇网络硬件：\r\n</p>\r\n<p>\r\n	网络接口卡（网卡）：每块网卡都有唯一的一个固定的硬件地址，称为MAC地址。\r\n</p>\r\n<p>\r\n	◇传输介质：网络的物理通道，分为有线介质和无线介质两种。\r\n</p>\r\n<p>\r\n	无线介质：无线电波、红外线、微波、激光等。\r\n</p>\r\n<p>\r\n	有线介质：双绞线、同轴电缆、光缆等\r\n</p>\r\n<p>\r\n	◇　连接设备：中继器、集线器、交换机、路由器等\r\n</p>\r\n<p>\r\n	◇　工作站和网络服务器：\r\n</p>\r\n<p>\r\n	网络中的计算机按其功能的不同有工作站(Workstation)与服务器(Server)之分，工作站也称客户机(Client)。享受服务器所提供的服务的那些计算机，我们称之为工作站。\r\n</p>\r\n<p>\r\n	网络服务器是指在网络中为客户端计算机（客户机）机提供服务功能的计算机，它能够提供网络管理、运行应用程序、处理各网络工作站成员的信息请示等等服务。\r\n</p>\r\n<p>\r\n	网络软件：\r\n</p>\r\n<p>\r\n	◇ 网络操作系统。常用的网络操作系统有Windows NT、Windows 2000、Novell、Netware、Unix和Linux等\r\n</p>\r\n<p>\r\n	◇　网络应用软件（包含应用软件和管理软件）。\r\n</p>\r\n<p>\r\n	常用的应用软件：\r\n</p>\r\n<p>\r\n	解压缩工具（WINRAR、ZIP）\r\n</p>\r\n<p>\r\n	文件下载工具等（迅雷、电驴、QQ旋风、Flashget、网络蚂蚁、FTP等）\r\n</p>\r\n<p>\r\n	文件上传工具（FTP、QQ文件上传工具等）\r\n</p>\r\n<p>\r\n	网络媒体播放器（Windows Media Player、暴风影音、豪杰超级解霸等）。\r\n</p>\r\n<p>\r\n	网络管理软件：网络管理员用来对网络资源进行管理，对网络进行维护的软件。\r\n</p>\r\n<p>\r\n	◇　网络通信软件，是执行各种网络通信协议和通信功能的程序（QQ、MSN、飞信、网络电话等）。\r\n</p>\r\n<p>\r\n	计算机网络的拓扑结构（常分为星形结构、总线结构、环形结构等三种）\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '走进网络世界', '※　计算机网络及其主要功能计算机网络：是利用通信设备和线路（有线的或无线的），将地理上分散分布的具有独立功能的多台计算机相互连接，以功能完善的网络软件实现网络中资源共享和信息传递的系统。计算机网络有四', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL),
(15, 26, '第2章　网络通信技术和局域网', '', '田礼成', '2018-04-18 00:00:00', '<p>\r\n	※　数据与信号\r\n</p>\r\n<p>\r\n	数据通信：是以通信技术和计算机技术为基础的通信方式，它为计算机网络的应用和发展提供了支持和通信环境。数据通信主要解决计算机中的二进制数据的传输和处理。\r\n</p>\r\n<p>\r\n	信号分为模拟信号和数字信号两种。\r\n</p>\r\n<p>\r\n	在计算机内部的电路和输入、输出端口作用的是离散的数字信号。\r\n</p>\r\n<p>\r\n	电话机的送话器输出的语音信号是连续的模拟信号。\r\n</p>\r\n<p>\r\n	调制：将计算机输出的数字信号转变为适合在普通电话线上传输的电磁波，这一过程称为调制。\r\n</p>\r\n<p>\r\n	解调：接收信息时，把从公用电话网上接收的电磁波恢复成数字信号，这一过程称为解调。\r\n</p>\r\n<p>\r\n	※　信道与带宽\r\n</p>\r\n<p>\r\n	信源：产生和发送信号的一端叫信源。\r\n</p>\r\n<p>\r\n	信宿：接收信号的一端叫信宿。\r\n</p>\r\n<p>\r\n	信道：传送和接收信号的通道为信道。\r\n</p>\r\n<p>\r\n	信道根据传输介质可分为：有线信道（双绞线、同轴电缆）和无线信道（电磁波）\r\n</p>\r\n<p>\r\n	信道根据传输信号可分为：模拟信道和数字信道。\r\n</p>\r\n<p>\r\n	带宽：通信信道的传输容量称为带宽。\r\n</p>\r\n<p>\r\n	模拟信道的带宽：等于信道能通过的最高频率和最低频率之差，通常用赫兹（Hz）表示\r\n</p>\r\n<p>\r\n	数字信道的带宽：单位时间内信道所能传输的最大比特数，用比特率（bps）表示。\r\n</p>\r\n<p>\r\n	※　信息交换技术\r\n</p>\r\n<p>\r\n	通信系统的信息交换技术：线路交换、报文交换、分组交换\r\n</p>\r\n<p>\r\n	※　OSI参考模型：把从计算机硬件的连接接口开始，到人们在屏幕上看到的应用信息为止的一系统网络与通信功能，按层次加以划分，构建一个7层的模型，分别为：物理层、数据链路层、网络层、传输层、会话层、表示层和应用层。\r\n</p>\r\n<p>\r\n	※	TCP/IP协议――因特网的互联基础\r\n</p>\r\n<p>\r\n	TCP/IP协议是因特网中最基本的网络通信协议族。整个协议分成3层，分别是：应用层、TCP协议层和IP协议层，TCP协议和IP协议是最重要的核心协议。\r\n</p>\r\n<p>\r\n	应用层协议包括有：邮件传送协议（简称SMTP）、文件传送协议（简称FTP）和浏览网页的超文体传送协议（简称HTTP）。\r\n</p>\r\n<p>\r\n	IP协议的工作是把数据包从一个地方传递到另一个地方。\r\n</p>\r\n<p>\r\n	TCP协议的工作是对数据包进行管理与校核，保证数据包的正确性。\r\n</p>\r\n<p>\r\n	TCP/IP协议是组建局域网的首选协议，也是因特网的主要协议。\r\n</p>\r\n<p>\r\n	※　IP地址\r\n</p>\r\n<p>\r\n	◇　IP地址的格式\r\n</p>\r\n<p>\r\n	IP地址是所在网络中的每台独立的计算机的唯一识别标志。\r\n</p>\r\n<p>\r\n	网络之间实现计算机的相互通信，必须有相应的地址标识，这个地址标识称为IP地址。\r\n</p>\r\n<p>\r\n	IP地址是由32位二进制位(bit)组成。为了方便起见，常用“点分十进制”方式来表示。即将IP地址分为4个字节，每个字节以十进制数(0～255)来表示，各个数之间以英文圆点来分隔。\r\n</p>\r\n<p>\r\n	每个IP地址有两部分组成，网络标识netid和主机标识hostid。网络标识确定了该主机所在的物理网络，主机标识确定了在某一物理地址上的一台主机。\r\n</p>\r\n<p>\r\n	3.2 IP地址的分类\r\n</p>\r\n<p>\r\n	将IP地址空间划分为A、B、C、D、E五类，每类有不同长度的网络标识和主机标识。\r\n</p>\r\n<p>\r\n	A类IP地址的第一个数取值范围为1—127。 B类IP地址的第一个数取值范围为128—191。\r\n</p>\r\n<p>\r\n	C类IP地址的第一个数取值范围为192—223。D类IP地址的第一个数取值范围为224—239。\r\n</p>\r\n<p>\r\n	E类IP地址的第一个数取值范围为240—255。\r\n</p>\r\n<p>\r\n	※ IP地址的管理\r\n</p>\r\n<p>\r\n	IP地址按照分级的方式管理；ICANN，负责全球IP地址与域名的管理；CNNIC（中国互联网络信息中心），负责中国IP地址与域名的管理。\r\n</p>\r\n<p>\r\n	※ IPV6\r\n</p>\r\n<p>\r\n	IPV4由32个二进制位(bit)组成，取值为4段范围在0—255之间的十进制数。\r\n</p>\r\n<p>\r\n	IPV6由128个二进制位(bit)组成，表现形式为8段4位16进制。\r\n</p>\r\n<p>\r\n	IPV6地址数量非常多，安全机制也增强了。\r\n</p>\r\n<p>\r\n	◆　网关\r\n</p>\r\n<p>\r\n	网关(Gateway)是连接基于不同通信协议的网络的设备，使数据可以在这些网络之间传输。网关可以说是一个网络与外界联系的出口。\r\n</p>\r\n<p>\r\n	网关可以是硬件，如路由器、服务器等，也可以是软件。\r\n</p>\r\n<p>\r\n	※　域名系、域名解过程及管理工具\r\n</p>\r\n<p>\r\n	域名系统（简称DNS）是指因特网的命名方案。域名系统的本质是发明了一种基于域的分组命名方案和一个用于执行该方案的分布式数据库系统。\r\n</p>\r\n<p>\r\n	域名(Domain Name)：是因特网上一个服务器或一个网络系统的名字，网络间通过域名进行相互访问，在全世界没有重复的域名。每台计算机的域名由一系列下圆点分开的字符串组成，如新浪网某台主机的域名是：www.sina.com.cn\r\n</p>\r\n<p>\r\n	其中最左边的段www是单台计算机的名称，其它字段标识了拥有该域名的组织。Sina表示该域名的拥有者是新浪。\r\n</p>\r\n<p>\r\n	按地理来分：中国（大陆地区）cn、中国（台湾地区）tw、中国（香港地区）hk，英国uk、美国是us，日本是jp等。\r\n</p>\r\n<p>\r\n	按组织来分：com---商业组织、edu----教育机构、gov ----政府机构、mil---军事组织、net---网络机构、Org---非盈利组织、int---国际组织。\r\n</p>\r\n<p>\r\n	◆　域名解析：因特网上的计算机之间是通过IP地址来进行通信的，域名必须转换成IP地址才能实现对网站的访问，这项工作由域名解析系统（DNS）来完成。这一过程称为域名解析。\r\n</p>\r\n<p>\r\n	域名的管理机构：全球域名的管理职责由“因特网域名与地址管理机构(ICANN)”来承担, 该组织是一个非盈利性组织。\r\n</p>\r\n<p>\r\n	我国的域名管理职责由“中国互联网络信息中心(CNNIC)” 承担。\r\n</p>\r\n<p>\r\n	DNS：域名系统服务器，将域名转换为IP地址。\r\n</p>\r\n<p>\r\n	※ &nbsp;因特网的接入方式和服务组织\r\n</p>\r\n<p>\r\n	㈠采用普通电话线接入方式\r\n</p>\r\n<p>\r\n	⑴使用调制解调器拨号接入。\r\n</p>\r\n<p>\r\n	⑵ISDN接入：综合业务数字网，俗称“一线通”。一根电话线上提供电话、传真、数字通信等业务。可以同时进行。ISDN最高传输速率为128Kbps。\r\n</p>\r\n<p>\r\n	⑶ADSL接入：“非对称数字用户线路”，这是一种利用普通电话线路实现宽带上网方式。\r\n</p>\r\n<p>\r\n	㈡专线接入方式\r\n</p>\r\n<p>\r\n	⑴Cable Modem接入：即电缆调制解调器，是一种利用专用电缆或有线电视网（CATV）进行数据传输的接口技术。\r\n</p>\r\n<p>\r\n	⑵DNN专线接入：数字数据网的简称，利用光纤、微波或卫星等数字信道，以传输数据信号为主的信号网络。特点：数字专线、传输速率高、质量好、延时小。\r\n</p>\r\n<p>\r\n	⑶光纤接入：即FTTX+LAN方式，是一种宽带接入方式。即光纤＋局域网模式。\r\n</p>\r\n<p>\r\n	㈢通过局域网接入因特网。\r\n</p>\r\n<p>\r\n	在局域网中，将已通过DDN专线、ADSL专线等方式接入因特网的计算机或路由器设置成网关或代理服务器。学校、企业或机构多采用，现在一般家庭也采用ADSL＋路由方式。\r\n</p>\r\n<p>\r\n	㈣无线接入方式\r\n</p>\r\n<p>\r\n	主要有：GPRS是通用分组无线业务的简称，是一种全球手机系统（GSM)为基础的分组交换数据传输技术。CDMA1X（中国联通）.\r\n</p>\r\n<p>\r\n	※　因特网服务组织\r\n</p>\r\n<p>\r\n	因特网的接入服务由因特网服务提供者（ISP）提供，又称因特网接入服务商。如：中国电信、中国联通等。\r\n</p>\r\n<p>\r\n	应用服务提供商：(简称ASP)，提供软件租赁服务并负责软件的管理和维护，如电子商务、电子邮件、网络会议、信息安全管理等软件。\r\n</p>\r\n<p>\r\n	因特网内容提供者：（简称ICP），主要在因特网上以网站的形式提供内容及信息，像雅虎、搜狐等都属于此类组织。\r\n</p>\r\n<p>\r\n	※　网络应用软件结构\r\n</p>\r\n<p>\r\n	浏览器/服务器（B/S，Brower/Server）结构：使用该结构，可以直接在浏览器中操作。\r\n</p>\r\n<p>\r\n	客户机/服务器（C/S，Client/Server）结构：使用该结构，需要安装客户端软件，如CuteFTP等。\r\n</p>\r\n<p>\r\n	C/S模式软件升级，必须是服务器和客户端一起升级，而B/S模式的升级，只需要在服务器升级就行。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '网络通信技术和局域网', '※　数据与信号数据通信：是以通信技术和计算机技术为基础的通信方式，它为计算机网络的应用和发展提供了支持和通信环境。数据通信主要解决计算机中的二进制数据的传输和处理。信号分为模拟信号和数字信号两种。在计', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL),
(16, 26, '第3章　因特网技术应用', '', '田礼成', '2018-04-18 00:00:00', '<p class=\"MsoNormal\" style=\"text-indent:21.0pt;background:white;\">\r\n	<p>\r\n		※　因特网信息检索工具――搜索引擎及其类型\r\n	</p>\r\n	<p>\r\n		搜索引擎：是指对因特网上的站点资源和其他网络资源进行标引和检索的一类检索系统机制，由信息收集软件、索引数据库和查询接口三部分组成。\r\n	</p>\r\n	<p>\r\n		搜索引擎按搜索机制可分为三类：全文搜索引擎、目录搜索引擎和元搜索引擎。\r\n	</p>\r\n	<p>\r\n		全文搜索引擎：是通过用户输入关键词来查找所需的信息资源。只要该关键词在数据库中的某个网页中出现，则这个网页就会作为匹配结果返回给用户。主要有（Google、百度、AltaVista）\r\n	</p>\r\n	<p>\r\n		目录搜索引擎：是把搜集到的信息资源按照一定的主题进行分类，建立层次目录。目录搜索引擎中最具代表的有Yahoo、搜狐、新浪、网易。\r\n	</p>\r\n	<p>\r\n		元搜索引擎：也称为集成搜索引擎，它将用户的检索请求同时送到多个引擎进行搜索，并将结果返回给用户。著名的有MetaCrawler、Ask、Dogpile、搜乐搜索（Sooule）等。\r\n	</p>\r\n	<p>\r\n		※　因特网信息检索工具的使用技巧\r\n	</p>\r\n	<p>\r\n		正确选择检索工具、选择合适的关键词、合理利用“网页快照”“网页预览”和“相关搜索”、研究检索提供的说明等。\r\n	</p>\r\n	<p>\r\n		◆　因特网的基本服务\r\n	</p>\r\n	<p>\r\n		※www服务（万维网）Word Wide Web（WWW），世界范围的网。万维网采用B/S工作模式。\r\n	</p>\r\n	<p>\r\n		万维网的网页是一种“超文本文件”，是用超文本标记语言（HTML）编写的。\r\n	</p>\r\n	<p>\r\n		统一资源定位符（URL），表明某网页在网络中的位置。\r\n	</p>\r\n	<p>\r\n		URL格式：协议名称://主机名/目录名/文件名\r\n	</p>\r\n	<p>\r\n		例1：http://www.ntzx.net.cn/webfile/index.htm\r\n	</p>\r\n	<p>\r\n		例2：ftp://ftp.ntzx.cn/downfile/student.rar\r\n	</p>\r\n	<p>\r\n		HTTP：超文本传输协议，是TCP/IP协议中的一种，使用TCP协议。\r\n	</p>\r\n	<p>\r\n		※　电子邮件：E-mail 。\r\n	</p>\r\n	<p>\r\n		格式：用户名@邮件服务器名。\r\n	</p>\r\n	<p>\r\n		例1：xww@mail.ntjy.net &nbsp; 例2：wcr@sina.com\r\n	</p>\r\n	<p>\r\n		两种常用的邮件协议：\r\n	</p>\r\n	<p>\r\n		SMTP：简单邮件传送协议，使用计算机中的110端口。\r\n	</p>\r\n	<p>\r\n		POP3 ：邮局协议第三版，使用计算机中的25端口。\r\n	</p>\r\n	<p>\r\n		※　文件传输 :最常用的TCP/IP之一\r\n	</p>\r\n	<p>\r\n		文件传输协议（FTP）也是因特网上重要服务之一。\r\n	</p>\r\n	<p>\r\n		FTP也是TCP/IP协议中的一种，使用TCP协议。\r\n	</p>\r\n	<p>\r\n		FTP一般采用C/S工作模式。 常用的FTP工具有Cuteftp软件等。\r\n	</p>\r\n	<p>\r\n		※　电子公告牌系统（BBS）\r\n	</p>\r\n	<p>\r\n		通过发“帖子”参与讨论，表达自己的观点。BBS与“电子论坛”几乎是一致的。\r\n	</p>\r\n	<p>\r\n		※　远程登录\r\n	</p>\r\n	<p>\r\n		远程登录（Telnet）也是TCP/IP协议中的一种，采用C/S工作模式。\r\n	</p>\r\n	<p>\r\n		◆　因特网服务的应用领域：电子商务、网上娱乐、远程教育、远程医疗、网上金融（网上银行、网上证券、网上保险和网上支付与结算）。\r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>\r\n</p>', '因特网技术应用', '※　因特网信息检索工具――搜索引擎及其类型搜索引擎：是指对因特网上的站点资源和其他网络资源进行标引和检索的一类检索系统机制，由信息收集软件、索引数据库和查询接口三部分组成。搜索引擎按搜索机制可分为三类', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL),
(17, 26, '第4章 网站的设计与评价', '', '田礼成', '2018-04-18 00:00:00', '<p>\r\n	㈠网站、网页、主页的概念及其相互关系\r\n</p>\r\n<p>\r\n	网站：因特网上具有相似性质、共同内容的一组信息资源就是一个网站。构成一个网站的基本元素是各种各样的文件以及存放这些文件的文件夹。\r\n</p>\r\n<p>\r\n	网页：网页是用HTML语言写成的文件，他存放在某一台计算机中，而这台计算机必须是与因特网相连的。\r\n</p>\r\n<p>\r\n	主页：主页实际上也是网页，通常用来表示访问某个网站时出现的的第一个页面。\r\n</p>\r\n<p>\r\n	㈡网站的规划与设计\r\n</p>\r\n<p>\r\n	需求分析：建立网站前应明确建设网站的目的，确定网站的功能以及网站的规模、投入费用以及进行必要的市场分析等。\r\n</p>\r\n<p>\r\n	选题：选择网站主题，制定网站栏目，设计网站风格（标志、主色调、文字效果、版面布局），规划网站结构，确定网站运行环境，选择网站开发工具，分配网站开发任务。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '网站的设计与评价', '㈠网站、网页、主页的概念及其相互关系网站：因特网上具有相似性质、共同内容的一组信息资源就是一个网站。构成一个网站的基本元素是各种各样的文件以及存放这些文件的文件夹。网页：网页是用HTML语言写成的文件', '0', '0', '马文林', '2018-04-18 00:00:00', '', '', 0, 0, NULL, NULL);
