(16, 3, 4, 'information', '360回应木马获免杀认证：将重拳打击', '（原标题：360回应木马实现免杀认证：杜绝此类事件再次发生）【TechWeb报道】3月24日消息，央视财经频道《经济与法》栏目曝光了一起新型木马病毒盗窃支付宝资金案。犯罪嫌疑人主要针对淘宝商家，以询问', '作者', '2016-03-09'),
(17, 20, 9, 'information', '第1章  绪言 ', '1.什么是信息&nbsp;&nbsp;信息是客观事物存在的第三种基本形态，也是区别于物质与能量的第三类资源。信息可以用来消除客观事物的不确定性，从而帮助人们解决问题、科学决策，指导人们的行动。&nbs', '马文林', '2018-04-18'),
(18, 20, 10, 'information', '第2章  信息获取', '1.网络信息检索&nbsp;&nbsp;因特网上有一种非常有效的信息搜索工具——搜索引擎。利用搜索引擎获取信息有两种主要方式:目录检索和关键词查询。⑴目录检索：使用目录检索网站有yahoo（雅虎）、s', '马文林', '2018-04-18'),
(19, 20, 11, 'information', '第3章  信息加工与表达', '1.信息的加工信息加工包括以下几个方面：◇信息加工的需求确定◇文本信息的加工：word、wps&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;◇数据信息的加工：excel金山表格◇图片信息', '马文林', '2018-04-18'),
(23, 26, 15, 'information', '第2章　网络通信技术和局域网', '※　数据与信号数据通信：是以通信技术和计算机技术为基础的通信方式，它为计算机网络的应用和发展提供了支持和通信环境。数据通信主要解决计算机中的二进制数据的传输和处理。信号分为模拟信号和数字信号两种。在计', '马文林', '2018-04-18'),
(24, 26, 16, 'information', '第3章　因特网技术应用', '※　因特网信息检索工具――搜索引擎及其类型搜索引擎：是指对因特网上的站点资源和其他网络资源进行标引和检索的一类检索系统机制，由信息收集软件、索引数据库和查询接口三部分组成。搜索引擎按搜索机制可分为三类', '马文林', '2018-04-18'),
