(17, 0, 4, '小刚（邮箱地址：xiaogang@sohu.com）要在百度网站上搜索、下载一张“金丝猴”图片，并通过自己的电子邮箱以附件形式把该图片发送到王老师(邮箱地址：teacherwang@qq.com)的邮箱里作为小组活动的图片素材。请你为小刚选择以下正确的操作过程。 （1）打开IE浏览器，在地址栏中输入http://www.baidu.com，登录百度网站。 （2）在网站中点击“图片”分类，并在搜索栏中输入（  ①  ），单击“百度一下”按钮。 （3）在查找到的结果中，鼠标右击需要下载的图片，在弹出的快捷菜单里，选择（  ②  ），将该图片下载到小刚的计算机，并以C:\\KS\\金丝猴.jpg的文件名保存下来。 （4）小刚登录自己的邮箱，在收件人栏填上邮箱地址(  ③  )，主题栏填上“金丝猴图”，并单击（  ④  ）链接，找到C:\\KS\\金丝猴.jpg，并将该文件添加到邮件里，点击“发送”按钮将邮件发送出去。', 'a:4:{i:0;i:18;i:1;i:19;i:2;i:20;i:3;i:21;}', NULL, '搜索图片发送邮件', 1, NULL, NULL, NULL, '2012会考', '2016-04-14'),
