(157, 0, 1, '<p>下面关于信息的描述，错误的是（）。</p>', 'a:4:{s:7:\"optionA\";s:46:\"<p>信息是用来消除确定性的东西</p>\";s:7:\"optionB\";s:63:\"<p>信息就是信息，不是物质，也不是能量<br/></p>\";s:7:\"optionC\";s:46:\"<p>信息是事物运动的状态和方式</p>\";s:7:\"optionD\";s:97:\"<p>信息是对事物运动的状态和方式的表征，能够消除认识上的不确定性</p>\";}', 'optionA', '香农：信息是用来消除不确性的东西  维纳：信息是区别于物质与能量的第三类资源  钟义信：信息是事物运动的状态和方式', 1, NULL, NULL, NULL, '', '2018-06-01'),
